import React, { useRef, useEffect, useState } from 'react';
import axios from 'axios';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import Typography from '@mui/material/Typography';


import CardItem from './CardItem';

const Item = styled(Paper)(({ theme }) => ({
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));

const App = () => {
    const [recommendationData, setRecommendationData] = useState();
    const [isLoaded, setIsLoaded] = useState(false);

    useEffect(() => {
    axios.get('http://localhost:8080/recommend')
            .then((response) => {
                console.log(response);
                setRecommendationData(response.data);
            }).catch((error) => {
                console.log(error);
            }).then(()=>{
                console.log("Finally")
            });  
    },[]);

    useEffect(()=> {
        if (!recommendationData) return;
        setIsLoaded(true);
        console.log("do render")

    });


    return (

    <Grid container spacing={2} >
        <Grid item xs={12}>
            <Typography sx={{ mt: 4, mb: 2}} variant="h2" component="div" textAlign="center">
                Coins Recommendation
            </Typography>
        </Grid>

        <Grid item xs = {4} textAlign= "right">
            <Typography sx={{ mt: 4, mb: 2, paddingRight: 10 }} variant="h4" component="div" textAlign= "right">
                    BTC
            </Typography>
        </Grid>
        <Grid item xs = {4}>
            <Typography sx={{ mt: 4, mb: 2, paddingRight: 20,textAlign: "left"}} variant="h4" component="div" >
                     ETH
            </Typography>
        </Grid>

        <Grid item xs={5} md ={6} container justifyContent="right"  >

            {recommendationData ? 
            recommendationData.exchangeBTCList.map((item, index) => {

            return ( 
                    <Item key = {index}>
                        <CardItem item = {item}/> 
                    </ Item>
                    );
                }

            ) : null}
        </Grid>

        <Grid item xs={5} md ={6} container justifyContent="left"  >

            {recommendationData ? 
            recommendationData.exchangeETHList.map((item, index) => {

            return (
                    <Item key = {index}>
                        <CardItem item = {item}/> 
                    </ Item>);
               }) : null }
        </Grid> 

        <Grid item xs={12} spacing={2}>

            <Typography sx={{ mt: 4, mb: 2}} variant="h3" component="div" textAlign="center">
                Recommendation Buy and Sell
            </Typography>
        </Grid>

            <Grid item xs = {6}>
            <Typography sx={{ mt: 4, mb: 2, textAlign: "center"}} variant="h6" component="div">
                    BTC
            </Typography>
            </Grid>
            <Grid item xs = {6}>
            <Typography sx={{ mt: 4, mb: 2, textAlign: "center"}} variant="h6" component="div">
                     ETH
            </Typography>
            </Grid>



            <Grid item xs={3}   >
                <Item> Where Buy</Item>
            </Grid>
            <Grid item xs={3}   >
                <Item> Where Sell</Item>
            </Grid>



            <Grid item xs={3}   >
                <Item> Where Buy</Item>
            </Grid>
            <Grid item xs={3}   >
                <Item> Where Sell</Item>
            </Grid>

       <Grid item xs= {12} height = {100}/>

      </Grid>
      );
}

export default App;
